import api from './services/api';
import './App.css';

export default function App() {
  return (
    <div className="api">
      <p className='text'> Testando API </p>
      <p className='user'> User </p>
      <button className='one'>1</button>
      <button className='two'>2</button>
      <br />
      <p className='restaurants'> Restaurants </p>
      <button className='three'>3</button>
      <button className='four'>4</button>
      <br />
      <p className='meals'> Meals </p>
      <button className='three'>5</button>
      <button className='four'>6</button>
    </div>
  );
}
